import Input from '../common/Input';
import './RightSidePanel.css';
import RightSidePanelHeader from './RightSidePanelHeader';

function RightSidePanel() {
  return (
    <div className="right_side_panel">
      <RightSidePanelHeader/>
      <div className="right_side_panel__body">
          <Input 
            className="input__input_group-prefix"
            prefixClassName="visible"
            prefixLabel="с"
            inputIconLeftClassName="hidden"
            iconRight={13}
            label="Дата оформления"
            placeholder="ДД.ММ.ГГГГ"
            value="20.01.2021"
          ></Input>
          <Input 
            className="input__input_group-prefix"
            prefixClassName="visible"
            prefixLabel="с"
            inputIconLeftClassName="hidden"
            iconRight={13}
            label="Дата оформления"
            placeholder="ДД.ММ.ГГГГ"
            value="20.01.2021"
          ></Input>
      </div>
    </div>
  );
}

export default RightSidePanel;
